import React,{Component} from 'react';
import { Menu, Icon } from 'antd';
import { Carousel } from 'antd';
import {  Link } from "react-router-dom";
import reqwest from "reqwest";
const personalRecommendUrl = "http://localhost:5000/easyreading/personal_recommend";
const num = 4; // 个性化推荐书籍数目
// 展示菜单栏和“个性化推荐”书籍
export default class IndexHeaderCenter extends Component{
    constructor(props){
        super(props);
        let user = JSON.parse(localStorage.getItem("user") || sessionStorage.getItem("user"));
        this.state = {
            data:[],
            user:user,
        }
    }
    componentDidMount(){
        // 从服务器获取所有书籍
        reqwest({
            url:`${personalRecommendUrl}/${this.state.user.id}/${num}`,
            type:'json',
            method:'get',
            error:(err)=>console.log(err),
            success:(res)=>{
                console.log(JSON.stringify(res));
                this.setState({...this.state,data:res});
            }
        });
    }

    handleClick = (e) => {
        console.log('click ', e);
        this.setState({
            current: e.key,
        });
    };
    render(){
        // 这里展示的用户每日的个性化推荐
        // 从服务器获取当天的个性化推荐书籍列表
        // 服务器应该在每晚23:59时生成第二天的个性化推荐列表
        // 从服务器端获取数据的url：localhost:3000/easyreading/books/personalBooks
        // 这里只需要获取每本书籍的id,name,img即可
        /*const personalizedBooks = [{id:"w1",name:"京华烟云",imgSrc:"data:image/jpeg;base64,"},
            {id:"w2",name:"平凡的世界",imgSrc:"https://ss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=371034499,3682267558&fm=26&gp=0.jpg"}];*/
        const personalizedBooks =  this.state.data;
        return(
            <div>
                <Menu
                    onClick={this.handleClick}
                    selectedKeys={[this.state.current]}
                    mode="horizontal"
                    className="indexMenu"
                >
                    <Menu.Item key="all">
                        <Link to="/bookCity">全部</Link>
                    </Menu.Item>
{/*                    <Menu.Item key="rank">
                      排行
                    </Menu.Item>*/}
               {/*做不完了     <Menu.Item key="list">
                        <Link to="/bookList">书单</Link>
                    </Menu.Item>*/}

                </Menu>
            <Carousel autoplay  >
                {
                    personalizedBooks ?
                        personalizedBooks.map((book) =>{
                    return(
                        <div key={book.id}>
                            <Link to={`/bookCity/books/${book.id}`} key={book.id}> <img alt={book.name} src={book.imgUrl} /></Link>
                        </div>
                    );
                }) : ""}
            </Carousel>
            </div>
            );


    }
}